import React from 'react';
export function List(props) {

  return (
    <ul className="App-list">
      {props.items.map((item, i) => (
        <li key={i}>
          <h4>{item.name}</h4>
          <p>{item.model}</p>
          <button>
            Edit
          </button>
          <button>
            Delete
          </button>
        </li>
      ))}
    </ul>
  )
}
